import * as React from "react";
import { styled, alpha } from "@mui/material/styles";
import { Button } from "@material-tailwind/react";
import { TextField } from "@mui/material";
import FilterAltRoundedIcon from "@mui/icons-material/FilterAltRounded";
import AddCircleOutlineRoundedIcon from "@mui/icons-material/AddCircleOutlineRounded";
import SearchIcon from "@mui/icons-material/Search";

import Box from "@mui/material/Box";
import Card from "@mui/material/Card";
import CardActions from "@mui/material/CardActions";
import CardContent from "@mui/material/CardContent";

import "./test.css";
import { AddPhotoAlternate } from "@mui/icons-material";

const Search = styled("div")(({ theme }) => ({
  position: "relative",
  borderRadius: theme.shape.borderRadius,
  backgroundColor: alpha(theme.palette.common.white, 0.15),
  "&:hover": {
    backgroundColor: alpha(theme.palette.common.white, 0.25),
  },
  marginLeft: 0,
  width: "100%",
  [theme.breakpoints.up("sm")]: {
    marginLeft: theme.spacing(1),
    width: "auto",
  },
}));

const SearchIconWrapper = styled("div")(({ theme }) => ({
  padding: theme.spacing(0, 2),
  height: "100%",
  position: "absolute",
  pointerEvents: "none",
  display: "flex",
  alignItems: "center",
  justifyContent: "center",
}));

const test = () => {
  return (
    <div className="flex justify-center">
      <form action="" className="container">
        <div className="addProduct-navbar container flex  justify-between border shadow">
          <h4 className="text-xl font-bold uppercase p-4">Create Product</h4>
          <Search>
            <SearchIconWrapper>
              <SearchIcon />
            </SearchIconWrapper>
            <StyledInputBase
              placeholder="Searchâ€¦"
              inputProps={{ "aria-label": "search" }}
            />
          </Search>
        </div>
        <div className="form-items w-full flex justify-between">
          <div className="form-left w-80 border">
            <div className="form-input-item">
              <label htmlFor="proName">Product Title</label>
              <br />
              <TextField
                id="filled-basic"
                label="Enter product title"
                variant="filled"
                name="proName"
              />
            </div>
            <div className="form-input-item">
              <label htmlFor="proName">Product Description</label>
              <br />

              <TextField
                id="filled-multiline-static"
                multiline
                rows={4}
                variant="filled"
              />
            </div>
          </div>
          <div className="form-right"></div>
        </div>
      </form>
    </div>
  );
};

export default test;
